import java.util.Arrays;
import java.util.HashMap;

/**
 * Created by Alex on 2/21/2017.
 */
public class StringsMakingAnagrams {

    public static void main(String[] args) {
        System.out.println(numberNeeded("",
                ""));
    }

    public static int numberNeeded(String first, String second) {
        int deletion = 0;
        char[] patternArr;
        char[] arr;
        if (first.length() < second.length()){
            patternArr = first.toCharArray();
            arr = second.toCharArray();
        }
        else{
            patternArr = second.toCharArray();
            arr = first.toCharArray();
        }
        if (Arrays.equals(patternArr, arr))
            return 0;
        else{
            HashMap<Character, Character> pattern= new HashMap<Character, Character>();
            //create map
            for (int i = 0; i < patternArr.length; i++){
                pattern.put(patternArr[i], patternArr[i]);
            }

            for (int i = 0; i < arr.length; i++){
                if (pattern.get(arr[i]) == null)
                    deletion++;
                else
                    pattern.remove(arr[i]);
            }
            deletion += pattern.size();
        }
        return deletion;
    }
}
